import logo from './logo.svg';
import './App.css';
import { findByLabelText } from '@testing-library/react';


function App() {
  const container = {
    margin: '0 auto',
    width: '900px'
  }

  const row = {
    display: 'flex',
    margin: '0 auto',
    width: 'fit-content'
  }

  const score = {
    width: '40px',
    height: '40px',
    backgroundColor: 'grey',
    borderRadius: '100%',
  }

  return (
    <div className="App" style={container}>
      <h1>내 일주일은?</h1>
      <div style={row}>
        <p>금</p>
        <div style={score}></div>
        <div style={score}></div>
        <div style={score}></div>
        <div style={score}></div>
        <div style={score}></div>
      </div>

    </div>
  );
}

export default App;
